import React from 'react'
import { renderRoutes } from 'react-router-config';
import {Top} from './style'
function Home (props) {
    const { route } = props;
    return (
        <div>
            <Top>
                <div>Home</div>
                { renderRoutes (route.routes) }
            </Top>
        </div>
    )
}

export default React.memo(Home)
